import logo from '../asserts/globalnav_apple_image__b5er5ngrzxqq_large.svg'
import store from '../asserts/globalnav_bag_image__yzte50i47ciu_large.svg'
import Mac from '../asserts/globalnav_links_accessories_image__edj0wqmfwxyu_large.svg'


const srcNav = [
    logo,
    store,
    Mac,
]

function Nav(){
    const ListeNav = srcNav.map((element) => 
    <img key={element.toString()} src={element} />
    )
    return (
        <ul className="nav">{ListeNav}</ul>
    )
}

export default Nav
